import 'package:flutter_fly_plout/bean/celebrity_work_entity.dart';import 'package:flutter_fly_plout/bean/search_result_entity.dart';import 'package:flutter_fly_plout/bean/comments_entity.dart';import 'package:flutter_fly_plout/bean/movie_long_comments_entity.dart';import 'package:flutter_fly_plout/bean/celebrity_entity.dart';import 'package:flutter_fly_plout/bean/subject_entity.dart';import 'package:flutter_fly_plout/pages/mine/bean/mine_response_bean_entity.dart';import 'package:flutter_fly_plout/pages/login/bean/login_response_bean_entity.dart';class EntityFactory {  static T generateOBJ<T>(json) {    if (1 == 0) {      return null;    } else if (T.toString() == "CelebrityWorkEntity") {      return CelebrityWorkEntity.fromJson(json) as T;    } else if (T.toString() == "SearchResultEntity") {      return SearchResultEntity.fromJson(json) as T;    } else if (T.toString() == "CommentsEntity") {      return CommentsEntity.fromJson(json) as T;    } else if (T.toString() == "MovieLongCommentsEntity") {      return MovieLongCommentsEntity.fromJson(json) as T;    } else if (T.toString() == "CelebrityEntity") {      return CelebrityEntity.fromJson(json) as T;    }  else if (T.toString() == "MineResponseBeanEntity") {      return MineResponseBeanEntity.fromJson(json) as T;    } else if (T.toString() == "LoginResponseBeanEntity") {      return LoginResponseBeanEntity.fromJson(json) as T;    } else {      return null;    }  }}